import React from "react";
import * as S from "styled-components";
const MovieCard = (movie) => {
    return (
        <S.MovieCardContainer
            backgroundImage={`https://www.themoviedb.org/t/p/w600_and_h900_bestv2/${movie.poster_path}`}
        >
            <S.MovieCard>
                <S.Title></S.Title>
                <S.Genre></S.Genre>
            </S.MovieCard>
        </S.MovieCardContainer>
    );
};

export default MovieCard;
